import React from "react";
import { BrowserRouter } from "react-router-dom";
import "./App.css";
import Navigation from "./js/components/Navigation";

function App() {
  return (
    <BrowserRouter>
      <Navigation />
    </BrowserRouter>
  );
}

export default App;
